import React from "react";
import Box from "./components/Box/Box";
import Grid from "./components/Grid/Grid";

function App() {
  return (
    <div
      className="App"
      style={{ margin: "16px", position: "relative", height: "100vh" }}
    >

      <Grid
        container
        spacing="sm"
        alignItems="center"
        style={{ height: "10%" }}
      >
        <Grid item xs={4} sm={4} md={4} lg={4}>
          <Box>Box 1</Box>
        </Grid>

        <Grid item xs={4} sm={4} md={4} lg={4}>
          <Box>Box 2</Box>
        </Grid>

        <Grid item xs={4} sm={4} md={4} lg={4}>
          <Box>Box 3</Box>
        </Grid>

        <Grid item xs={4} sm={4} md={4} lg={4}>
          <Box>Box 4</Box>
        </Grid>

        <Grid item xs={4} sm={4} md={4} lg={4}>
          <Box>Box 5</Box>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
